import React from 'react';
import { Link } from 'react-router-dom';
import './AdminDashboard.css';

const AdminDashboard = () => {
    return (
        <div className="admin-dashboard">
            <aside className="sidebar">
            </aside>
            <aside className="sidebar-2">
            </aside>
            <aside className="sidebar-3">
            </aside>

            <div className="main-content">
                    <h1>Admin Nexus</h1>
                <div className="functions">
                    <div className="function-card">
                        <p>Review claims submitted by users.</p>
                        <Link to="#approve-claims" className="btn"><h3>Approve Claims</h3></Link>
                    </div>
                    <div className="function-card">
                        <p>Add new health policies to the database for users to choose from.</p>
                        <Link to="#add-policies" className="btn"><h3>Add Policies</h3></Link>
                    </div>
                    <div className="function-card">
                        <p>Include hospitals in the network that offer cashless treatment.</p>
                        <Link to="#add-hospitals" className="btn"><h3>Add Hospitals</h3></Link>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AdminDashboard;
